function Data(){
    const arr= [1,2,3,4,5]
    var result = arr.map(
        <tr>
            <td>fgsg</td>
            <td>fdg</td>
            <td>dfg</td>
            <td>dfg</td>
            <td>dfg</td>
            <td>dfg</td>
        </tr>
    );
    return(result);
}

function Klijenti(){
    return(
        <div className='container'>
            <table className='table table-striped'>
                <thead>
                  <tr>
                    <th>Oib</th>
                    <th>Ime</th>
                    <th>Prezime</th>
                    <th>Adresa</th>
                    <th>Telefon</th>
                    <th>Spol</th>
                  </tr>
                </thead>
                <tbody>
                    <Data />
                </tbody>
            </table>
        </div>

    );
}
export default Klijenti();
